  const clickDate = useCallback((date) => {
    props.setStartDay(date);
  }, []);

  const startDate = new Date();
  console.log(startDate);

  return (
    <React.Fragment>
      <DatePicker selected={startDate} onChange={clickDate} />;
    </React.Fragment>
  );
};
export type CalenderProps = {
  startDate: string;
  setStartDay: (startDate: string) => void;
};

export default Calender;
